      SELECT ALL + - col1 + - col2 - + col1 * col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT col0 / + col0 NOT IN ( + ( - col2 ), col1, - - 43 * - 91 );
  - name: tab2

outputs:
  - name: q5208.out
    data: |
